import styled from 'styled-components';

function KatePage () {
    return(
        <Background>
            <Title>Hi Kate!</Title>
        </Background>
    );
}

const Background = styled.div`
    height: 100vh;
    width: 100%;
    background: pink;
`;

export default KatePage;
